import React from 'react'
import {BrowserRouter as Router, Switcher, Route, Switch} from 'react-router-dom';
import Home from './components/pages/Home'
import AboutUs from './components/pages/AboutUs'
import Services from './components/pages/Services'
import Custom from './components/pages/Custom'
import Navbar2 from './components/Navbar2'



function Links() {
  return (
    <>
      <Router>
        <Switch>
          <Route path='/' exact component={Home} /> 
          <Route path='/about-us' exact component={Products} /> 
          <Route path='/contact-us' exact component={Services} /> 
          <Route path='/custom' exact component={Custom} /> 

        </Switch>
      </Router>
    </>
  );
}

export default Links;
